      <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.7.1/jquery.min.js"></script>
      <script>
fetch('/api/seat').then(async(res)=>{
    let array=await res.json()
    console.log(array)
    for(let seat of array){
        let color="#000"
        if(seat.statusId==2){
            console.log('booked')
        }
        if(seat.statusId==1){
            color="#1cda07"
        }else{
            color="#da0707"
        }
        if(seat.sectorId==1){
            $('#arena-'+seat.row+'-'+seat.col).css({ fill: color })
        }else if(seat.sectorId==2){
            $('#stalls-'+seat.row+'-'+seat.col).css({ fill: color })
        }
    }
})

      </script>
